  return (
    <button
      disabled={disabled}
      onClick={onClick}
      style={{
        margin: "5px",
        padding: "10px 20px",
        cursor: disabled ? "not-allowed" : "pointer"
      }}
    >
      {title}
    </button>
  );
};

